    "debounce_percent": {                             "en": "If using the automatic animation, the animation dots could flicker/jump, if the consuming is changing a lot. Define a percentage, to debounce the animation on the line. The higher the value, the more debounce.", "de": "Wenn Sie die automatische Animation verwenden, können die Animationspunkte flackern/springen, wenn sich der Verbrauch stark ändert. Definieren Sie einen Prozentsatz, um die Animation auf der Linie zu entprellen. Je höher der Wert, desto mehr Entprellung.", "ru": "При использовании автоматической анимации точки анимации могут мерцать/прыгать, если потребление сильно меняется. Определите процент, чтобы устранить дребезг анимации на линии. Чем выше значение, тем больше дребезг.", "pt": "Se estiver usando a animação automática, os pontos de animação podem piscar/pular, se o consumo estiver mudando muito. Defina uma porcentagem, para debounce a animação na linha. Quanto maior o valor, mais debounce.", "nl": "Als u de automatische animatie gebruikt, kunnen de animatiepunten flikkeren/springen als de consumptie veel verandert. Definieer een percentage, om de animatie op de lijn te laten stuiteren. Hoe hoger de waarde, hoe meer debounce.", "fr": "Si vous utilisez l'animation automatique, les points d'animation peuvent scintiller/sauter si la consommation change beaucoup. Définissez un pourcentage, pour faire rebondir l'animation sur la ligne. Plus la valeur est élevée, plus le rebond est important.", "it": "Se si utilizza l'animazione automatica, i punti dell'animazione potrebbero sfarfallare/saltare, se il consumo cambia molto. Definire una percentuale, per rimbalzare l'animazione sulla linea. Maggiore è il valore, maggiore è il rimbalzo.", "es": "Si usa la animación automática, los puntos de animación podrían parpadear/saltar, si el consumo está cambiando mucho. Defina un porcentaje, para rebotar la animación en la línea. Cuanto más alto sea el valor, más rebote.", "pl": "W przypadku korzystania z automatycznej animacji kropki animacji mogą migotać/skakać, jeśli konsumpcja bardzo się zmienia. Zdefiniuj procent, aby odbić animację na linii. Im wyższa wartość, tym większe odbicia.", "uk": "Якщо використовується автоматична анімація, точки анімації можуть мерехтіти/стрибати, якщо споживання сильно змінюється. Визначте відсоток, щоб усунути дребезг анімації на лінії. Чим вище значення, тим більше відбій.", "zh-cn": "如果使用自动动画，如果消耗变化很大，动画点可能会闪烁/跳跃。定义一个百分比，去抖动画就行了。值越高，去抖越多。"},
