    "ex_automatic_animation": {                       "en": "(if activated, the animation will calculate the speed depending on the consumption - higher consumption, higher speed - maximum speed is the duration of the animation)", "de": "(Wenn aktiviert, berechnet die Animation die Geschwindigkeit abhängig vom Verbrauch - höherer Verbrauch, höhere Geschwindigkeit - maximale Geschwindigkeit ist die Dauer der Animation)", "ru": "(если активировано, то анимация будет рассчитывать скорость в зависимости от расхода - чем больше расход, тем выше скорость - максимальная скорость равна продолжительности анимации)", "pt": "(se ativado, a animação calculará a velocidade dependendo do consumo - maior consumo, maior velocidade - velocidade máxima é a duração da animação)", "nl": "(indien geactiveerd berekent de animatie de snelheid afhankelijk van het verbruik - hoger verbruik, hogere snelheid - maximale snelheid is de duur van de animatie)", "fr": "(si activé, l'animation calculera la vitesse en fonction de la consommation - consommation plus élevée, vitesse plus élevée - la vitesse maximale correspond à la durée de l'animation)", "it": "(se attivato, l'animazione calcolerà la velocità in base al consumo - maggiore consumo, maggiore velocità - la velocità massima è la durata dell'animazione)", "es": "(si está activado, la animación calculará la velocidad en función del consumo - a mayor consumo, mayor velocidad - la velocidad máxima es la duración de la animación)", "pl": "(jeśli jest aktywna, animacja obliczy prędkość w zależności od zużycia - wyższe zużycie, wyższa prędkość - maksymalna prędkość to czas trwania animacji)", "uk": "(якщо активовано, анімація розраховуватиме швидкість залежно від споживання - більше споживання, вища швидкість - максимальна швидкість - це тривалість анімації)", "zh-cn": "（如果激活，动画将根据消耗计算速度 - 消耗越高，速度越高 - 最大速度是动画的持续时间）"},
