    "ex_battery_discharge": {                         "en": "Data point for discharging your battery",          "de": "Datenpunkt zum Entladen Ihres Akkus",              "ru": "Точка данных для разрядки аккумулятора",           "pt": "Ponto de dados para descarregar sua bateria",      "nl": "Datapunt voor het ontladen van uw batterij",       "fr": "Point de données pour décharger votre batterie",   "it": "Punto dati per scaricare la batteria",             "es": "Punto de datos para descargar su batería",         "pl": "Punkt danych do rozładowania baterii",             "uk": "Точка даних для розрядки акумулятора",             "zh-cn": "电池放电数据点"},
