    "ex_threshold": {                                 "en": "a threshold over or under which values are handled.<br>10 for values greater than 10 or -10 Watts / or 0.01 for values greater than 0.01 or -0.01 kW.<br>This value affects the color too.", "de": "eine Schwelle, über oder unter der Werte behandelt werden.<br>10 für Werte größer als 10 oder -10 Watt / oder 0,01 für Werte größer als 0,01 oder -0,01 kW.<br>Dieser Wert wirkt sich auch auf die Farbe aus.", "ru": "пороговое значение, выше или ниже которого обрабатываются значения.<br>10 для значений больше 10 или -10 Вт / или 0,01 для значений больше 0,01 или -0,01 кВт.<br>Это значение также влияет на цвет.", "pt": "um limite acima ou abaixo do qual os valores são manipulados.<br>10 para valores maiores que 10 ou -10 Watts / ou 0,01 para valores maiores que 0,01 ou -0,01 kW.<br>Esse valor também afeta a cor.", "nl": "een drempel waarboven of waaronder waarden worden afgehandeld.<br>10 voor waarden groter dan 10 of -10 Watt / of 0,01 voor waarden groter dan 0,01 of -0,01 kW.<br>Deze waarde heeft ook invloed op de kleur.", "fr": "un seuil au-dessus ou en-dessous duquel les valeurs sont gérées.<br>10 pour les valeurs supérieures à 10 ou -10 Watts / ou 0,01 pour les valeurs supérieures à 0,01 ou -0,01 kW.<br>Cette valeur affecte également la couleur.", "it": "una soglia al di sopra o al di sotto della quale vengono gestiti i valori.<br>10 per valori superiori a 10 o -10 Watt / o 0,01 per valori superiori a 0,01 o -0,01 kW.<br>Questo valore influisce anche sul colore.", "es": "un umbral por encima o por debajo del cual se manejan los valores.<br>10 para valores superiores a 10 o -10 vatios / o 0,01 para valores superiores a 0,01 o -0,01 kW.<br>Este valor también afecta al color.", "pl": "próg, powyżej lub poniżej którego obsługiwane są wartości.<br>10 dla wartości większych niż 10 lub -10 Watów / lub 0,01 dla wartości większych niż 0,01 lub -0,01 kW.<br>Ta wartość wpływa również na kolor.", "uk": "поріг, який перевищує або нижче якого обробляються значення.<br>10 для значень більше 10 або -10 Вт / або 0,01 для значень більше 0,01 або -0,01 кВт.<br>Це значення також впливає на колір.", "zh-cn": "处理高于或低于该值的阈值。<br>10 表示大于 10 的值或 -10 瓦 / 或 0.01 表示大于 0.01 或 -0.01 千瓦的值。<br>此值也会影响颜色。"},
